import React from "react";

export default Login => {
    return (
        <>
        <section className="left">
        <form className="login">
            <input type="text" name="email" placeholder="E-Mail" />
            <input type="passowrd" name="password" placeholder="Password"/>
        </form>
        </section>
        </>
    )
}
